import "./App.css";
import BabyNamesData from "./babyNamesData.json";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="container">
      <div className="row row-cols-10">
        {BabyNamesData.map((babyName) => (
          <div
            className={
              babyName.sex === "m"
                ? "col backgroundGreen"
                : "col backgroundOrange"
            }
            key={babyName.id}
          >
            {babyName.name}
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
